import './App.css';


import {BrowserRouter,  Route, Link, Routes} from 'react-router-dom'
import Home from './pages/Home';

function App() {
  return (
    <BrowserRouter>
      <ul>
        <li><Link to="/home">Home</Link></li>

      </ul>  
      <Routes>
        <Route exact path="/home">
          <Home/>
        </Route>  


      </Routes>
    </BrowserRouter>
  );
}

export default App;
